const intialState = {
  products: [
    {
      id:1,
      title:'dhiral',
      category:'programmer'
    }
  ]
};

const productReducer = (state = intialState, action) => {
  switch (action.type) {
    case "ADD_ITEM": {
      state.push(action.payload);
      console.log("ADD_ITEM reducer==== ", state);
      return state;
    }
    default:
      return state;
  }
};

export default productReducer;
